import React from "react";
import "./Projects.css";
import Aos from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";


const Projects = () => {
  
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  let project = [
    {
      sNo: 1,
      image: "assets/Screenshot (30).png",
      title: "e-Notebook",
      link: "",
      description: "A online notebook with signup and login options",
    },
    {
      sNo: 2,
      image: "assets/Screenshot (29).png",
      title: "NewsDino",
      link: "",
      description: "A news app",
    },
    {
      sNo: 1,
      image: "assets/Screenshot (32).png",
      title: "TextEditooor",
      link: "",
      description: "A text editing website that have multiple functions",
    },
    {
      image: "assets/Screenshot (25).png",
      title: "",
      link: "",
      description: "",
    },
  ];
  return (
    <>
      <section id="project-container">
        <h2>Projects</h2>
        <hr />
        <div className="row">
        {project.map((elem) => {
          const { title, description, link, image } = elem;
          return (
            <div className="col-lg-4" data-aos= "zoom-in-right">
              <div className="card d-flex" key={title}>
                <img src={image} className="card-img-top" alt="..." />
                <div className="card-body">
                  <div className="d-flex">
                  <h5 className="card-title">{title}</h5>
                  <a href={link}>
                    <i className="fa-solid fa-link mx-2"></i>  
                  </a>
                  </div>
                  <p className="card-text">{description}</p>
                </div>
              </div>
            </div>
          );
        })}
        </div>
      </section>
    </>
  );
};

export default Projects;
